import React, { useEffect, useState } from "react";
import axios from "axios";

const categories = ["house", "room", "sofa", "bathroom"];

const Services = () => {
  const [selectedCategory, setSelectedCategory] = useState("house");
  const [services, setServices] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const fetchServices = async (category) => {
    setLoading(true);
    setError("");
    try {
      const response = await axios.get(
        `http://localhost:7001/api/auth/services/${category}`
      );

      if (Array.isArray(response.data)) {
        setServices(response.data);
      } else if (
        response.data.services &&
        Array.isArray(response.data.services)
      ) {
        setServices(response.data.services);
      } else {
        setServices([]);
        setError("Unexpected API response format");
      }
    } catch (err) {
      setError("Failed to fetch services");
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchServices(selectedCategory);
  }, [selectedCategory]);

  return (
    <div className="container mx-auto px-6 py-12">
      <h1 className="text-4xl font-extrabold mb-10 text-center text-gray-900 tracking-tight">
        Our Services
      </h1>

      <div className="mb-10 flex justify-center">
        <select
          className="p-3 border border-gray-300 rounded-lg text-lg font-semibold text-gray-700 
                     focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500
                     transition duration-300"
          value={selectedCategory}
          onChange={(e) => setSelectedCategory(e.target.value)}
          aria-label="Select service category"
        >
          {categories.map((cat) => (
            <option key={cat} value={cat}>
              {cat.charAt(0).toUpperCase() + cat.slice(1)} Service
            </option>
          ))}
        </select>
      </div>

      {loading ? (
        <p className="text-center text-xl text-gray-500 animate-pulse">Loading...</p>
      ) : error ? (
        <p className="text-center text-red-600 font-semibold text-lg">{error}</p>
      ) : services.length === 0 ? (
        <p className="text-center text-gray-500 text-lg mt-5">
          No services found for{" "}
          <span className="font-semibold">{selectedCategory}</span>
        </p>
      ) : (
        <div className="grid gap-10 grid-cols-1 sm:grid-cols-2 lg:grid-cols-3">
          {services.map((service) => (
            <article
              key={service._id || service.service || Math.random()}
              className="bg-white rounded-xl shadow-lg overflow-hidden
                         hover:shadow-2xl transform hover:-translate-y-1 transition-all duration-300
                         cursor-pointer flex flex-col"
              tabIndex={0}
              aria-label={`${
                service.type || service.service || "Service"
              } details`}
            >
              <img
                src="https://via.placeholder.com/400x200?text=Service+Image"
                alt={service.service || service.type || "Service image"}
                className="w-full h-48 object-cover"
              />

              <div className="p-6 flex flex-col flex-grow">
                {selectedCategory === "house" ? (
                  <>
                    <h2 className="text-2xl font-semibold mb-3 text-gray-900">
                      {service.type || "Untitled Service"}
                    </h2>
                    <p className="text-gray-700 mb-6 flex-grow leading-relaxed">
                      {service.description || "No description provided."}
                    </p>
                    <div className="text-gray-900 font-semibold space-y-2 border-t border-gray-200 pt-4">
                      <p>
                        Furnished Price:{" "}
                        <span className="text-indigo-600">₹{service.furnished ?? "N/A"}</span>
                      </p>
                      <p>
                        Unfurnished Price:{" "}
                        <span className="text-indigo-600">₹{service.unfurnished ?? "N/A"}</span>
                      </p>
                    </div>
                  </>
                ) : (
                  <>
                    <h2 className="text-2xl font-semibold mb-3 text-gray-900">
                      {service.service || "Untitled Service"}
                    </h2>
                    <p className="text-gray-700 mb-6 flex-grow leading-relaxed">
                      {service.description || "No description provided."}
                    </p>
                    <p className="text-gray-900 font-semibold border-t border-gray-200 pt-4">
                      Price: <span className="text-indigo-600">₹{service.price ?? "N/A"}</span>
                    </p>
                  </>
                )}
              </div>
            </article>
          ))}
        </div>
      )}
    </div>
  );
};

export default Services;
